// Devuelve todos los lugares en orden (ndices corresponden a la matriz)
export function getFullNodeOrder(): PredefinedPlace[] {
  return [...predefinedPlaces];
}

// Extrae una sub-matriz para los nodos seleccionados
export function extractSubMatrix(
  selectedIndices: number[]
): number[][] {
  const n = selectedIndices.length;
  const subMatrix: number[][] = [];
  
  for (let i = 0; i < n; i++) {
    const row: number[] = [];
    for (let j = 0; j < n; j++) {
      const origI = selectedIndices[i];
      const origJ = selectedIndices[j];
      row.push(MASTER_DISTANCE_MATRIX[origI][origJ]);
    }
    subMatrix.push(row);
  }
  
  return subMatrix;
}

// Extrae las polylines para los nodos seleccionados
export function extractSubPolylines(
  selectedIndices: number[]
): Record<string, google.maps.LatLngLiteral[]> {
  const subPolylines: Record<string, google.maps.LatLngLiteral[]> = {};
  const n = selectedIndices.length;
  
  for (let i = 0; i < n; i++) {
    for (let j = 0; j < n; j++) {
      if (i === j) continue;
      
      const origI = selectedIndices[i];
      const origJ = selectedIndices[j];
      
      // Buscar la polyline en ambas direcciones
      const key1 = `${origI}_${origJ}`;
      const key2 = `${origJ}_${origI}`;
      
      let polyline: google.maps.LatLngLiteral[] | undefined;
      
      if (MASTER_POLYLINES[key1]) {
        polyline = MASTER_POLYLINES[key1];
      } else if (MASTER_POLYLINES[key2]) {
        // Invertir la polyline si est en la direccin opuesta
        polyline = [...MASTER_POLYLINES[key2]].reverse();
      }
      
      if (polyline) {
        // Usar nuevos ndices para la sub-matriz
        subPolylines[`${i}_${j}`] = polyline;
      }
    }
  }
  
  return subPolylines;
}

// Obtiene el ndice de un lugar en predefinedPlaces
export function getPlaceIndex(placeId: string): number {
  return predefinedPlaces.findIndex(p => p.id === placeId);
}

// === Funciones de cache (mantenidas por compatibilidad) ===
const CACHE_KEY = 'espol_full_distance_matrix';
const CACHE_VERSION = 'v1';

interface CachedMatrix {
  version: string;
  timestamp: number;
  matrix: number[][];
  polylines: Record<string, { lat: number; lng: number }[]>;
}

export function cacheMatrix(
  matrix: number[][],
  polylines: Record<string, google.maps.LatLngLiteral[]>
): void {
  const cached: CachedMatrix = {
    version: CACHE_VERSION,
    timestamp: Date.now(),
    matrix,
    polylines: polylines as Record<string, { lat: number; lng: number }[]>
  };
  
  try {
    localStorage.setItem(CACHE_KEY, JSON.stringify(cached));
  } catch (e) {
    console.warn('No se pudo guardar la matriz en cache:', e);
  }
}

export function getCachedMatrix(): {
  matrix: number[][];
  polylines: Record<string, google.maps.LatLngLiteral[]>;
} | null {
  try {
    const cached = localStorage.getItem(CACHE_KEY);
    if (!cached) return null;
    
    const data: CachedMatrix = JSON.parse(cached);
    if (data.version !== CACHE_VERSION) return null;
    if (data.matrix.length !== predefinedPlaces.length) return null;
    
    const thirtyDays = 30 * 24 * 60 * 60 * 1000;
    if (Date.now() - data.timestamp > thirtyDays) return null;
    
    return {
      matrix: data.matrix,
      polylines: data.polylines
    };
  } catch (e) {
    console.warn('Error al leer matriz del cache:', e);
    return null;
  }
}

export function clearMatrixCache(): void {
  localStorage.removeItem(CACHE_KEY);
}

export function hasCachedMatrix(): boolean {
  return getCachedMatrix() !== null;
}
